import React,{Component} from "react";

function ListProfils(props){
    return(
        <div>
         <img src = {props.p.img} alt={`icon of ${props.p.name}`}/>

          <p>Id : {props.p.id}</p>
          <p>Name : {props.p.name}</p>
          <p>Email : {props.p.email}</p>
          <p>Mobile : {props.p.mobile}</p>
          </div>
    );}

    export default ListProfils ;
